/*Table structure for table `sponsees` */

DROP TABLE IF EXISTS `sponsees`;

CREATE TABLE `sponsees` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `firstname` varchar(100) DEFAULT NULL,
  `lastname` varchar(100) DEFAULT NULL,
